import React from "react";
import {Column, ColumnProps} from 'react-virtualized'
import HeaderCell from "./HeaderCell";


interface IProps extends ColumnProps{
    key: string
    dataKey: string
    headerValue: string
}

const TableColunm: React.FC<IProps> = (props) =>{

    const {key, dataKey, width, headerValue, style} = props

    const cellRenderer = React.useCallback((cellData: any, columnData: any, dataKey: string, rowData: any, rowIndex: number) =>{
        return(<div>{cellData}</div>)
    },[])

    return(
        <Column
            key={key}
            style={style}
            dataKey={dataKey} 
            width={width}
            cellRenderer={(data) =>cellRenderer(data.cellData, data.columnData, data.dataKey, data.rowData, data.rowIndex)}
            headerRenderer={() => (<HeaderCell value = {headerValue}/>)}
            // cellDataGetter={({dataKey, rowData}) => rowData[dataKey]}
        />
    )
} 

export default TableColunm
